function webpackGetQs(name) {

    _urlParams = [];
    //Get all querystring params and make it avail in _urlParams
    var match,
        pl = /\+/g,  // Regex for replacing addition symbol with a space
        search = /([^&=]+)=?([^&]*)/g,
        decode = function (s) { return decodeURIComponent(s.replace(pl, " ")); },
        query = window.location.search.substring(1);

    //_urlParams = {};
    while (match = search.exec(query))
        _urlParams[decode(match[1])] = decode(match[2]);

    return _urlParams[name] === true || _urlParams[name] === 'true' || _urlParams[name] === 'True' || _urlParams[name] === 'TRUE';
}
